SYM_LAYOUTPROPS.description:
Props for Next.js App Router layout components
@example
```tsx
export default function Layout(props: LayoutProps<'/dashboard'>) {
return <div>{props.children}</div>
}
```

SYM_MERGEREFS.description:
Merges multiple React refs into a single ref callback. Handles both callback
refs and RefObject refs.
@template T - The element type for the refs
@param refs - Array of refs to merge (can include undefined values)
@returns A ref callback that forwards the node to all provided refs
@internal

SYM_SUBSCRIBETOMOUNTED.description:
Subscribes to mounted state changes for useSyncExternalStore.
@param callback - Function to call when mounted state changes
@returns Unsubscribe function
@internal

SYM_ALERTDIALOGHEADER.description:
Header container for AlertDialog title and description.
Flex column layout for organizing the dialog's title and description. Text is
centered on mobile and left-aligned on larger screens.
@param props - Header div props
@param props.className - Additional CSS classes
@param props.children - Header content (title, description)
@returns React div element styled as dialog header

SYM_DIALOGTRIGGER.description:
Dialog trigger component.
Button or element that opens the dialog when clicked. Automatically manages
aria attributes and keyboard interactions.
@example
```tsx
<DialogTrigger asChild>
<Button>Open Dialog</Button>
</DialogTrigger>
```;
@param props - Dialog trigger props from Radix UI
@param props.asChild - Render as child component (default: false)
@param props.children - Trigger content (typically Button)
@param props... - All other Radix UI Dialog.Trigger props
@returns React dialog trigger component
@see {@link Dialog}

SYM_BUTTONGROUP.description:
Button group container component.
Groups related buttons together with connected borders and shared styling.
Supports both horizontal and vertical orientations. Automatically handles
border radius and border removal for seamless button connections.
@example
```tsx
// Horizontal button group
<ButtonGroup>
<Button>First</Button>
<Button>Second</Button>
<Button>Third</Button>
</ButtonGroup>
// Vertical button group
<ButtonGroup orientation="vertical">
<Button>Top</Button>
<Button>Middle</Button>
<Button>Bottom</Button>
</ButtonGroup>
```;
@param props - ButtonGroup component props
@param props.className - Additional CSS classes to merge with variant classes
@param props.orientation - Button group orientation ("horizontal" |
"vertical")
@param props.children - Button group content (buttons, inputs, selects)
@param props... - All other standard div HTML attributes
@returns React button group component
@see {@link buttonGroupVariants} For available variants

SYM_ALERTDIALOG.description:
Root component for the AlertDialog.
Provides the context for all AlertDialog sub-components. Manages the
open/closed state of the dialog.
@example
```tsx
<AlertDialog>
<AlertDialogTrigger>Open</AlertDialogTrigger>
<AlertDialogContent>
<AlertDialogHeader>
<AlertDialogTitle>Are you sure?</AlertDialogTitle>
<AlertDialogDescription>This action cannot be undone.</AlertDialogDescription>
</AlertDialogHeader>
<AlertDialogFooter>
<AlertDialogCancel>Cancel</AlertDialogCancel>
<AlertDialogAction>Continue</AlertDialogAction>
</AlertDialogFooter>
</AlertDialogContent>
</AlertDialog>
```;
@param props - AlertDialog root props from Radix UI
@param props.open - Controlled open state
@param props.defaultOpen - Default open state for uncontrolled usage
@param props.onOpenChange - Callback when open state changes
@param props.children - AlertDialog trigger and content
@returns React AlertDialog root component
@see {@link https://www.radix-ui.com/primitives/docs/components/alert-dialog Radix UI AlertDialog}

SYM_GETTHEMEVARIANTSNAPSHOT.description:
