SYM_DIALOGPORTAL.description:
Dialog portal component.
Renders dialog content in a portal outside the main DOM tree. Ensures proper
z-index stacking and prevents layout issues.
@param props - Dialog portal props from Radix UI
@param props.container - Portal container element (default: document.body)
@param props.children - Content to portal (typically DialogContent)
@param props... - All other Radix UI Dialog.Portal props
@returns React dialog portal component
@internal
@see {@link DialogContent}

SYM_AVATARIMAGE.description:
Avatar image component that displays the user's avatar image.
Displays an image within the Avatar container. Automatically falls back to
AvatarFallback if the image fails to load or is unavailable.
@example
```tsx
<AvatarImage src="/user-avatar.jpg" alt="John Doe" />
```;
@param props - Component props extending AvatarPrimitive.Image
@param props.src - Image source URL
@param props.alt - Alternative text for the image (required for
accessibility)
@param props.className - Additional CSS classes to merge
@param props... - All other standard img HTML attributes
@returns React avatar image component
@see {@link Avatar}
@see {@link AvatarFallback}

SYM_DIALOG.description:
Dialog root component.
Root container for dialog system. Manages dialog state (open/closed) and
provides context to child components. Must wrap all other dialog components.
@example
```tsx
<Dialog>
<DialogTrigger>Open</DialogTrigger>
<DialogContent>
<DialogTitle>Title</DialogTitle>
<DialogDescription>Description</DialogDescription>
</DialogContent>
</Dialog>
```;
@param props - Dialog root props from Radix UI
@param props.open - Controlled open state
@param props.defaultOpen - Uncontrolled default open state
@param props.onOpenChange - Callback when open state changes
@param props.modal - Whether dialog is modal (default: true)
@param props.children - Dialog content (typically DialogTrigger and
DialogContent)
@param props... - All other Radix UI Dialog.Root props
@returns React dialog root component
@see {@link https://www.radix-ui.com/primitives/docs/components/dialog Radix UI Dialog}
@see {@link DialogTrigger}
@see {@link DialogContent}

SYM_COUNTINGALERT.description:
Tracks render count for variant change testing.
@param props - Component props
@param props.variant - Alert variant
@returns Alert component with specified variant

SYM_BUTTONGROUPTEXT.description:
Button group text label component.
A text label that can be used within a button group to provide context or
grouping information. Supports both standard div rendering and custom
components via the asChild prop.
@example
```tsx
// Standard text label
<ButtonGroupText>Filter by:</ButtonGroupText>
// Custom component
<ButtonGroupText asChild>
<Label>Filter by:</Label>
</ButtonGroupText>
```;
@param props - ButtonGroupText component props
@param props.asChild - If true, renders as child component using Radix Slot
@param props.className - Additional CSS classes to merge
@param props.children - Text label content
@param props... - All other standard div HTML attributes
@returns React button group text component
@see {@link https://www.radix-ui.com/primitives/docs/components/slot Radix UI Slot}

SYM_GETMOUNTEDSERVERSNAPSHOT.description:
Gets the mounted state for useSyncExternalStore (server).
@returns Always false on server
@internal

SYM_USEISINVIEW.description:
Hook for detecting when an element enters the viewport.
Uses Framer Motion's intersection observer-based detection with customizable
options for margin and once-only triggering.
@example
```tsx
const { ref, isInView } = useIsInView<HTMLDivElement>(null, {
inViewOnce: true,
inViewMargin: "100px"
});
return <div ref={ref}>{isInView && 'Visible!'}</div>;
```;
@template T - The HTML element type
@param ref - React ref to forward to the element
@param options - Configuration options
@param options.inView - If false, always returns true (disables detection)
@param options.inViewOnce - If true, only triggers once when element first
enters view
@param options.inViewMargin - Margin around viewport for triggering (e.g.
"100px")
@returns Object with ref to attach to element and isInView boolean

SYM_ASPECTRATIO.description:
AspectRatio component that maintains a consistent aspect ratio for its content.
@description Wraps content in a container that maintains a specific aspect ratio,
ensuring consistent sizing across different screen sizes. Commonly used for
images, videos, and other media that need to maintain proportions.
@param props - Component props extending AspectRatioPrimitive.Root
@param props.ratio - The aspect ratio to maintain (width/height, e.g., 16/9 = 1.777)
@param props.className - Additional CSS classes to apply
@param props.children - Content to maintain aspect ratio for
@param props... - All other AspectRatioPrimitive.Root props
@returns React component that maintains aspect ratio
@example
```tsx
<AspectRatio ratio={16 / 9}>
<img src="/image.jpg" alt="Description" />
</AspectRatio>
```
@example
```tsx
<AspectRatio ratio={1}>
<div className="bg-primary">Square content</div>
</AspectRatio>
```
@see {@link https://www.radix-ui.com/primitives/docs/components/aspect-ratio Radix UI AspectRatio}

