SYM_WITHASCHILD.description:
Utility type for components supporting the asChild composition pattern. When
asChild is true, the component renders its child instead of its default
element, merging props and motion capabilities onto the child.
@example
```tsx
// When asChild is true, must provide a single ReactElement child
<Button asChild>
<a href="/link">Link styled as button</a>
</Button>
```;
@template Base - The base props type to extend

SYM_BUTTONGROUPSEPARATOR.description:
Button group separator component.
A visual separator that can be placed between buttons in a button group.
Supports both horizontal and vertical orientations to match the button group
layout.
@example
```tsx
<ButtonGroup>
<Button>Action 1</Button>
<ButtonGroupSeparator />
<Button>Action 2</Button>
</ButtonGroup>
```;
@param props - ButtonGroupSeparator component props
@param props.className - Additional CSS classes to merge
@param props.orientation - Separator orientation ("horizontal" | "vertical")
@param props... - All other standard Separator HTML attributes
@returns React button group separator component
@see {@link Separator} For the base separator component

SYM_GETSTRICTCONTEXT.description:
Creates a type-safe React context with strict null checking.
Returns a Provider component and hook that throws an error if used outside
the Provider. Prevents common bugs from forgetting to wrap components in
context providers.
@example
```tsx
interface ThemeContextValue {
theme: 'light' | 'dark';
setTheme: (theme: string) => void;
}
const [ThemeProvider, useTheme] = getStrictContext<ThemeContextValue>('ThemeProvider');
function App() {
return (
<ThemeProvider value={{ theme: 'dark', setTheme }}>
<Child />
</ThemeProvider>
);
}
function Child() {
const { theme } = useTheme(); // Safe - throws if used outside Provider
return <div>{theme}</div>;
}
```;
@template T - The type of the context value
@param name - Optional name for error messages (e.g. "ThemeProvider")
@returns Tuple of [Provider, useContext] - Provider component and safe
context hook

SYM_ACCORDION.description:
Root component for the Accordion.
@description Provides context for accordion items and manages expanded state.
Supports single item expansion (default) or multiple item expansion modes.
@param props - Accordion root props from Radix UI
@param props.type - "single" for one item at a time, "multiple" for any number
@param props.collapsible - Allow all items to be collapsed (single mode only)
@param props.defaultValue - Default expanded item(s)
@param props.value - Controlled expanded item(s)
@param props.onValueChange - Callback when expanded items change
@param props.children - AccordionItem components
@returns React Accordion root component
@example
```tsx
// Single item expansion (default)
<Accordion type="single" collapsible>
<AccordionItem value="item-1">
<AccordionTrigger>Section 1</AccordionTrigger>
<AccordionContent>Content 1</AccordionContent>
</AccordionItem>
</Accordion>
// Multiple items can be expanded
<Accordion type="multiple">
<AccordionItem value="item-1">...</AccordionItem>
<AccordionItem value="item-2">...</AccordionItem>
</Accordion>
```
@see {@link https://www.radix-ui.com/primitives/docs/components/accordion Radix UI Accordion}
